    private final String name, url;
    private final Rank permission;
    private final SkinSubcategory subCategory;
    private final CustomProperty customProperty;

    @Getter
    private static final Skin[] values;

    static {
        values = values();
    }

    public static Skin getRandomSkin() {
        return getValues()[Constants.RANDOM.nextInt(values().length)];
    }

    public static Skin getSkin(final String name) {
        return Arrays.stream(getValues()).filter(skin -> skin.getName().contains(name)).findFirst().orElse(null);
    }

    public static List<Skin> getSkins(final SkinSubcategory skinSubcategory) {
        return Arrays.stream(getValues()).filter(skin -> skin.getSubCategory() == skinSubcategory).collect(Collectors.toList());
    }

